import React from 'react';
import s from './Header.module.css';

const Header = () => {
    return <header className={s.header}>
        <a href="https://www.youtube.com/channel/UCTW0FUhT0m-Bqg2trTbSs0g" target="_blank">
        <img
            src='https://psv4.userapi.com/c856428/u251915844/docs/d7/c58bb2c59091/PicsArt_03-27-08_23_01.png?extra=X6oxI2M82ajNHME1Xh2I5cpP_8Fsg7AUFAxW6H7oCU-tUIHs1kT_Doz_zZIu3x6E18JYr0XQLifTtiARQPZdNtsFYOusPxU5KLYCal0qAaIiHH3rRZJy5Am6XltYthZzxduGzosUH93-j27oDt4aIL0T29g' />
        </a>
    </header>
}


export default Header;
